iterations.yara_rule:
rule Bypass_Sample
{
    meta:
        description = "Evasion bypass by skipping conditional checks"
        cape_options = "bp0=$pattern0+0,action0=skip,bp1=$pattern1+0,action1=skip,bp2=$pattern2+0,action2=skip,count=0"

    strings:
        $pattern0 = { 85 C0 0F 84 ?? ?? ?? ?? ?? 8B 45 ?? }
        $pattern1 = { 6A ?? 5A 8B CE E8 ?? ?? ?? ?? ?? FF 75 ?? }
        $pattern2 = { FF C8 FF FF FF FF 00 40 E7 C3 }

    condition:
        any of them
}

